<!DOCTYPE html>
<html>
<head>
<title>GeoGebra Dynamic Worksheet</title>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, minimum-scale=1" />
<script src="web3d/js/webfont.js?v=1.15"></script>
</head>
<body>
    <script type="text/javascript" src="web3d/web3d.nocache.js"></script>
    
    <div id="parent">
    <div class="scaleme" style="height:100%;"><div>
    <article class="geogebraweb" data-param-showLogging="true"
   data-param-xshowAlgebraInput="true"
    data-param-xperspective="AG"
    data-param-xshowToolBar="true"
    data-param-scale="1"
    data-param-xallowStyleBar="true"
    data-param-prerelease="true"
    data-param-enableRightClick="false"
    data-param-showResetIcon="true"
    data-param-showTutorialLink="true"
    data-param-filename="https://cdn.geogebra.org/resource/jYTNR7uJ/zuJ2pQo7dBVOFYld/material-jYTNR7uJ.ggb"
    data-param-width="917"
    data-param-height="600"
    data-param-allowUpscale="false"
    data-param-allowScale="true"
    data-param-materialsApi="null"
    data-param-xscaleContainerClass="scaleme"
    data-param-showfullscreenbutton="true"
    data-param-height="588"></article>
    </div></div></div>
</body>
</html>
